import React from 'react'
import { Link } from 'react-router-dom'
import BookmarkIcon from '@mui/icons-material/Bookmark';
import ThumbUpIcon from '@mui/icons-material/ThumbUp';

const FeedWorkspaceCard = ({workspace}) => {
    return (
        <Link to={`/workspace/${workspace._id}`} className="feed-workspace-card">
            <img src="https://via.placeholder.com/1000" />
            <p>Workspace 2</p>
            <div>
                <p>Dylan Tate</p>
                <p>Updated 2 hours ago</p>
                <BookmarkIcon className="workspace" />
                <ThumbUpIcon />
            </div>
            <p>Description</p>
        </Link>
    )
}

export default FeedWorkspaceCard
